import React from 'react';

const VideoPlayer = () => {
    return (
        <div>
            <h1>Video Player</h1>
            <video controls width="200">
                <source src="/movie/motoshi.mp4" type="video/mp4" />
                Your browser does not support the video tag.
            </video>
        </div>
    );
};

export default VideoPlayer;
